import React, { Component } from 'react';
import MenuItems from './menuItems';

class Categoria extends Component{
    constructor(props){
        super(props);
        this.state = {
            visible:false
        }
    }
    render(){
        return (
            <div className = 'Categoria'>
                <li>
                    <h3>{this.props.name}</h3>
                    <ul>
                        {this.props.items.map()}
                    </ul>
                </li>
            </div>
        );
    }
}

export default Categoria;
